# Element stiffness matrix and load vector

def cpressvec(qx, qy, x1, x2, y1, y2):
    # Load vector due to distributed force of constant components qx, qy
    import numpy as np
    N = np.array([[2., 0.],
                  [0., 2.],
                  [2., 0.],
                  [0., 2.]])
    f = 0.5 * N@np.array([[qx], [qy]]) * np.sqrt((x2-x1)**2 + (y2-y1)**2)/2
    return f

